function Home() {
  return (
    <div>
      <h1> <img
                  src={`${process.env.PUBLIC_URL}/fyp-images/iconmusic.webp`}
                  width="120"
                  height="50"
                  alt="MoodMelody Logo"
                /> MoodMelody </h1>
      <p>This is the uploads page.</p>
    </div>
  );
}
export default Home;
